<script>
    import anime from 'animejs';

    export default {
        name: "animation",
        data() {
            return {
                elements: [],
                text: {
                    partOne: {
                        visible: true,
                        animation: 'fadeIn slower'
                    },
                    partTwo: {
                        visible: false,
                        animation: 'fadeIn slow'
                    },
                    partThree: {
                        visible: false,
                        animation: 'fadeIn slow'
                    }
                },
                button: {
                    visible: false,
                    animation: 'fadeIn slow'
                },
                mess: {
                    visible: false
                },
                stage: 0
            }
        },
        mounted() {
            window.setTimeout(() => {
                this.text.partOne.animation = 'fadeOut slower';
            }, 2250);
            window.setTimeout(() => {
                this.mess.visible = true;
                this.animate(1500, 'easeInOutExpo');
            }, 2500);
            window.setTimeout(() => {
                this.animate(1500, 'easeOutBack');
            }, 5000);
            window.setTimeout(() => {
                this.text.partOne.visible = false;
                this.text.partTwo.visible = true;
                this.text.partTwo.animation = 'fadeIn slower';
            }, 5250);
            window.setTimeout(() => {
                this.text.partThree.visible = true;

            }, 9000);
            window.setTimeout(() => {
                this.button.visible = true;

            }, 11000);
        },
        methods: {
            animate(duration, easing) {
                let elements = document.querySelectorAll('path');
                for (let i = 0; i < elements.length; i++) {
                    if (!!this.elements[i]) {
                        this.elements[i].duration = duration;
                        this.elements[i].easing = easing;
                        this.elements[i].reverse();
                        this.elements[i].play();
                        continue;
                    }

                    let el = elements[i];
                    let offset = anime.setDashoffset(el);
                    el.setAttribute('stroke-dashoffset', offset);

                    if (!this.elements[i]) {
                        this.elements[i] = anime({
                            targets: el,
                            strokeDashoffset: [offset, 0],
                            duration: duration,
                            delay: 0,
                            loop: false,
                            direction: 'alternate',
                            easing: easing,
                            autoplay: true
                        });
                    }
                }
            },
        }
    }
</script>

